import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import jobInfo from './ExperienceArray';

function Experience() {
  return (
    <section className="experience" style={{ paddingTop: '3rem' }}>
      <Container style={{ padding: '3rem' }}>
        <Row>
          <Col lg={10}>
            <h2 className="section-title">Experience</h2>
          </Col>
        </Row>
        {jobInfo.map((job) => (
          <Row>
            <Col lg={4} className="job-col-left">
              <div className="job-info text-right">
                <p className="job-title">{job.title}</p>
                <p className="section-dates">{job.start}&nbsp;-&nbsp;{job.end}</p>
              </div>
            </Col>
            <Col lg={8} className="job-col-right">
              <div>
                <p className="section-place"><a href={job.url} target="_blank">{job.company}</a></p>
                <p className="job-location"><i className="fa fa-map-marker"></i>{job.location}</p>
                <p className="section-description">{job.description}</p>
              </div>
            </Col>
          </Row>
        ))}
      </Container>
    </section>
  );
}

export default Experience;
